Now, the complement of set A, denoted by A', is the set of all elements in the universal set U that are not in set A. Similarly, the complement of set B, denoted by B', is the set of all elements in the universal set U that are not in set B.

A' = {x ∈ U | x ∉ A} = {2, 4, 6}
